sys_ux_client_script.script:
/**
 * @param {params} params
 * @param {api} params.api
 * @param {TransformApiHelpers} params.helpers
 */
function evaluateProperty({
    api,
    helpers
}) {

    const data = api.data.luAddress.results;
    return data.map(e => ({
        id: e.sys_id.value,
        label: e.address.value
    }));
}
